import React from "react";

function App () {

     const a=15;
     const b=15;
    return (
     <ul>
        <li>Sum of two no is {a+b}</li>
        <li>Sub of two no is {a-b}</li>
        <li>Div of two no is {a/b}</li>
        <li>Mult of two no is {a*b}</li>
     </ul>
    );
}

export default App;
